Sheher Tere ✈️ 
After 2 years of trying to put the best draft forward, we are releasing Sheher Tere on 03/05/24 🤍

A Story with loads of emotions attached. We’ve made nearly 100 mixes of this song & finally got the one we were looking for! Super excited to announce & reveal the cover art!

@aashi.jain23 being extremely beautiful with her artistic skills, did make a perfect art!! I hope you guys listen to this story & relate to it.

@aakash.ere & @jagrateeee have sung this one so beautifully!
@majormuzick helped in the production. Each one of them made this project possible.

A story worth listening. I hope you love it as much as we do ✈️🌚
